import React, { useState } from "react";
import { useNavigate } from "react-router-dom"; // For navigation

import { Button } from '@headlessui/react'; // Tailwind UI Button
import { RadioGroup } from '@headlessui/react'; // Tailwind UI RadioGroup
import { Checkbox } from '@headlessui/react'; // Tailwind UI Checkbox

export function CalculatorForm() {
  const navigate = useNavigate(); // React Router hook for navigation
  const [cycles, setCycles] = useState(1);
  const [selectedAgeRange, setSelectedAgeRange] = useState('30-34');
  const [csiProcedure, setCsiProcedure] = useState('no');
  const [pgtTesting, setPgtTesting] = useState('no');
  const [conditions, setConditions] = useState({
    pcos: false,
    endometriosis: false,
    lowOvarian: false,
    maleFactor: false,
  });

  const handleSubmit = (e) => {
    e.preventDefault();
    navigate("/result"); // Navigate to the result page
  };

  return (
    <div className="w-full max-w-3xl mx-auto p-6 bg-white shadow-md rounded-lg">
      <form onSubmit={handleSubmit} className="space-y-8">
        {/* Age Range Selection */}
        <div className="space-y-4">
          <h3 className="text-lg font-medium">Which age range applies to you?</h3>
          <RadioGroup value={selectedAgeRange} onChange={setSelectedAgeRange}>
            <div className="grid grid-cols-2 gap-4">
              {['under-30', '30-34', '35-37', '38-40', '41-43', 'above-43'].map((range) => (
                <RadioGroup.Option key={range} value={range}>
                  {({ checked }) => (
                    <div className={`flex items-center space-x-2 p-2 ${checked ? 'bg-blue-100' : ''}`}>
                      <span className="text-sm">{range}</span>
                    </div>
                  )}
                </RadioGroup.Option>
              ))}
            </div>
          </RadioGroup>
        </div>

        {/* IVF Cycles Slider */}
        <div className="space-y-4">
          <h3 className="text-lg font-medium">Number of IVF Cycles?</h3>
          <input
            type="range"
            min="1"
            max="5"
            step="1"
            value={cycles}
            onChange={(e) => setCycles(Number(e.target.value))}
            className="w-full"
          />
          <span className="text-sm text-muted-foreground">{cycles} cycle(s)</span>
        </div>

        {/* Previous Procedures */}
        <div className="space-y-4">
          <h3 className="text-lg font-medium">Have you undergone these procedures before?</h3>
          <div className="grid grid-cols-2 gap-4">
            <div>
              <h4 className="text-sm font-medium">CSI Procedure:</h4>
              <RadioGroup value={csiProcedure} onChange={setCsiProcedure}>
                <div className="flex space-x-4">
                  {['yes', 'no'].map((value) => (
                    <RadioGroup.Option key={value} value={value}>
                      {({ checked }) => (
                        <div className={`flex items-center space-x-2 p-2 ${checked ? 'bg-blue-100' : ''}`}>
                          <span className="text-sm">{value}</span>
                        </div>
                      )}
                    </RadioGroup.Option>
                  ))}
                </div>
              </RadioGroup>
            </div>

            <div>
              <h4 className="text-sm font-medium">PGT Testing:</h4>
              <RadioGroup value={pgtTesting} onChange={setPgtTesting}>
                <div className="flex space-x-4">
                  {['yes', 'no'].map((value) => (
                    <RadioGroup.Option key={value} value={value}>
                      {({ checked }) => (
                        <div className={`flex items-center space-x-2 p-2 ${checked ? 'bg-blue-100' : ''}`}>
                          <span className="text-sm">{value}</span>
                        </div>
                      )}
                    </RadioGroup.Option>
                  ))}
                </div>
              </RadioGroup>
            </div>
          </div>
        </div>

        {/* Medical Conditions */}
        <div className="space-y-4">
          <h3 className="text-lg font-medium">Do you have any of these medical conditions?</h3>
          <div className="grid grid-cols-2 gap-4">
            {[
              { id: 'pcos', label: 'PCOS' },
              { id: 'endometriosis', label: 'Endometriosis' },
              { id: 'lowOvarian', label: 'Low Ovarian Reserve' },
              { id: 'maleFactor', label: 'Male Factor Infertility' },
            ].map(({ id, label }) => (
              <div key={id} className="flex items-center space-x-2">
                <Checkbox
                  checked={conditions[id]}
                  onChange={(checked) => setConditions((prev) => ({ ...prev, [id]: checked }))}
                  id={id}
                  className="h-4 w-4"
                />
                <label htmlFor={id} className="text-sm">{label}</label>
              </div>
            ))}
          </div>
        </div>

        {/* Submit Button */}
        <div className="flex items-center justify-center min-h-screen">
  <Button
    type="submit"
    className="py-2 px-4 bg-blue-600 text-white font-medium rounded-md hover:bg-blue-700"
  >
    Calculate
  </Button>
</div>

      </form>
    </div>
  );
}
